import React from 'react';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import '../styles/MenuAppBar.css';
import LogoImage from '../assets/logo.jpeg';
import OtherHousesOutlinedIcon from '@mui/icons-material/OtherHousesOutlined';
import LocationIcon from '@mui/icons-material/LocationOn';
import axios from 'axios';
// import { GenIcon } from 'react-icons';
import { MenuBook } from '@mui/icons-material';
import { Dropdown } from '@mui/base';
//import HelpOutlineIcon from '@material-ui/icons/HelpOutline'; // Adjust based on your actual icons library


function MenuAppBar() {
  const navigate = useNavigate();

  const navigateToLocation = async () => {
    try {
      const userEmail = sessionStorage.getItem("userEmail");
      console.log("userEmail", userEmail);
      const response = await axios.get(`http://localhost:8081/api/posts/getPostsAroundUser/${userEmail}`);
      const locations = response.data;
      console.log("response", locations);
      navigate('/map', { state: { locations } });
    } catch (error) {
      console.error('Error fetching posts:', error);
      // Handle error as needed (e.g., show user a message)
    }
  };
  const navigateToHelpPosts = () => {
    // Function to navigate to HelpPosts
    navigate('/HelpPosts');
  };

  return (
    <div>
      <div className='navbar'>
        <div className="img-navbarLogo" style={{ backgroundImage: `url(${LogoImage})`, width: '50px' }}></div>
        <button style={{ backgroundColor: 'white', cursor: 'pointer', border: 'none', height: '7vmin' }}>
          <OtherHousesOutlinedIcon />
        </button>
        <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }} onClick={navigateToLocation}>
          <LocationIcon />
        </button>
        <div>
          {/* <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }}onClick={}>
            <MenuIcon />
          </button> */}
          <Dropdown />

        </div>
        <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }} onClick={navigateToHelpPosts}>
          <MenuBook />
        </button>
      </div>
    </div>
  );
}

export default MenuAppBar;
